import * as actionTypes from './action'

const initialState = {
    result: 0
};

const reducer = (state = initialState, action) => {
    switch (action.type) {
        case actionTypes.ZERO:
            return {result:0};
        case actionTypes.ONE:
            return {result:1};
        case actionTypes.TWO:
            return {result:2};
        case actionTypes.THREE:
            return {result:3};
        case actionTypes.FOUR:
            return {result:4};
        case actionTypes.FIVE:
            return {result:5};
        case actionTypes.SIX:
            return {result:6};
        case actionTypes.SEVEN:
            return {result:7};
        case actionTypes.EIGHT:
            return {result:8};
        case actionTypes.NINE:
            return {result:8};

        case actionTypes.ADD:
            return {result:'+'};
        case actionTypes.SUBTRACT:
            return {result:'-'};
        case actionTypes.MULTIPLY:
            return {result:'*'};
        case actionTypes.DIVIDE:
            return {result:'/'};

        case actionTypes.EQUAL:
            return {result:'='};
        default:
            return state;
    }
};

export default reducer;
